from django.test import TestCase
from django.test import Client
from classify.views import Bbox
import json

base64img_ty = ''
base64img_cp = ''
base64img_yp = ''
base64img_wd = ''
valid_header  = {'HTTP_TOKEN':'eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9.eyJhdWQiOiIxMzIyMjIifQ.LmQkgDkXXhNlqe5H_LlX6rWBCKkFUrDw7oMcGfNY8JQ'}
invalid_header = {'HTTP_TOKEN':'eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9.eyJhdWQiOiIxMzIyMjIifQ.LmQkgDkXXhNlqe5H_LlX6rWBCKkFUrDw7oMcGfNY8JJ'}

class DjangoBackendTest(TestCase):
    def test_rest_server(self):
        client = Client()
        self.assertEqual(client.post('/classify/',{'img':base64img_ty},).content,
                         b'INVALID REQUEST.')
        self.assertEqual(client.post('/classify/',{'tel':'101'}).content,
                         b'INVALID REQUEST.')
        self.assertEqual(client.post('/classify/', {'img': base64img_ty,'tel':'101'},**invalid_header).content,
                         b'FAILED IN TOKEN AUTHORIZATIAN')
        self.assertEqual(client.post('/classify/', {'img': base64img_ty, 'tel': '101','obj_type':3}, **valid_header).content,
                         b'obj_type must be 1 (single object) or 2 (multiple object)')
        self.assertEqual(
            client.post('/classify/', {'img': base64img_ty, 'tel': '101', 'obj_type': 2,'plate_type':3}, **valid_header).content,
            b'plate_type must be 1 (square plate) or 2 (round plate)')
        so_res = client.post('/classify/', {'img': base64img_ty, 'tel': '101'}, **valid_header).content
        so_json = so_res.decode('utf8').replace("'", '"')
        so_data = json.loads(so_json)
        self.assertEqual(so_data[0]['class'],'')
        wd_res = client.post('/classify/', {'img': base64img_wd, 'tel': '101'}, **valid_header).content
        wd_json = wd_res.decode('utf8').replace("'", '"')
        wd_data = json.loads(wd_json)
        self.assertEqual(wd_data[0]['class'], '')
        mo_res = client.post('/classify/', {'img': base64img_cp, 'tel': '101','obj_type':2}, **valid_header).content
        mo_json = mo_res.decode('utf8').replace("'", '"')
        mo_data = json.loads(mo_json)
        predictions = json.loads(mo_data['predictions'])
        self.assertEqual(len(predictions),4)
        yo_res = client.post('/classify/', {'img': base64img_yp, 'tel': '101','obj_type':2,'plate_type':2}, **valid_header)
        self.assertEqual(yo_res.status_code,200)

    def test_Bbox(self):
        bbox1 = Bbox(10,10,5,5,0)
        bbox2 = Bbox(4.5,5,5,5,0)
        bbox3 = Bbox(10,4.5,5,5,0)
        bbox4 = Bbox(10,4.49,5,5,0)
        self.assertEqual(bbox1.overlap(bbox2),True)
        self.assertEqual(bbox1.overlap(bbox3), True)
        self.assertEqual(bbox1.overlap(bbox4), False)
